INSERT INTO `joke` VALUES (1,1,1,'校长和英语老师一起去法国某中学访问，校长在礼堂讲话，英语老师做翻译。\n校长：“各位老师们，同学们！”\n英语老师：“ladies and gentlemen！”\n校长：“各位女士们，先生们！”\n英语老师-_-！想了下说：“Good morning！”\n校长：“早上好！”\n英语老师：……',NULL,282,39,63,50,26,'2014-07-21 12:58:14',0),(2,1,1,'说有一只北极熊，因为雪地太刺眼了，必须要戴墨镜才能看东西， 可是他找不到墨镜，于是闭着眼睛爬来爬去在地上找，爬呀爬呀，把手脚都爬的脏兮兮的才找到墨镜。 戴上墨镜，对着镜子一照，这才发现：哦，原来我是一只熊猫',NULL,276,80,95,81,0,'2014-07-21 13:04:32',0),(3,1,1,'小明明天要考试，但晚上却在看电视\n小明妈妈就担心地问：书都看完了吗？明天要考试啊\n小明就爽快地回答：妈，我看完了。\n小明妈妈就很开心的赞扬小明：乖，那明天你一定考得很好呢\n小明哭着说：妈，我是说，‘妈，我看，完了’。',NULL,270,39,78,57,0,'2014-07-21 13:21:14',0),(4,1,1,'士兵问连长：作战时踩到地雷咋办？连长大为恼火：靠，能咋办？踩坏了照价赔偿。',NULL,233,20,56,91,0,'2014-07-21 13:22:18',0),(5,1,1,'我和妻子已经18个月没说话了，我没机会打断她。',NULL,225,96,93,85,0,'2014-07-21 13:25:54',0),(6,1,1,'夏天，一只长颈鹿遇到一只兔子，她对兔子很得意地炫耀她的脖子： 啊，小兔子，你知道有个长长的脖子多好吗？你知道那些最高处的树叶是多么鲜嫩甜美吗？你知道夏天喝水的感觉吗？清爽的水慢慢经过脖子，兔子看了她一眼，只说了一句：”你试过吐没有？”',NULL,204,46,51,55,1,'2014-07-21 13:29:29',0),(7,1,1,'一个神父在打高尔夫球，一个修女在旁边观看，第一杆打偏了，神父骂道：“TMD，打偏了！”又打，神父又骂：“TMD，又打偏了！”修女说：“你做为神父说脏话上帝要惩罚的。”话音刚落，只听一个霹雷把修女给劈死了。神父纳闷了：为什么骂人的是我，为什么会劈死修女呢？这时只听天空传来上帝的声音：“TMD，我也打偏了！”',NULL,236,63,75,67,0,'2014-07-21 13:29:59',0),(9,2,1,'这身装束看着就拉风','/img/joke_web_1405921751747.jpg',270,26,71,72,0,'2014-07-21 13:49:34',0),(10,2,1,'骄傲的处女座','/img/joke_1_1405921930833.jpeg',2,3,83,61,0,'2014-07-21 13:52:10',0),(11,2,1,'这位大叔，遛狗专业点好伐','/img/joke_web_1405922755418.jpg',287,33,50,87,0,'2014-07-21 14:06:17',0),(12,2,1,'好大坑。。','/img/joke_web_1405922827926.jpg',229,84,51,54,0,'2014-07-21 14:07:19',0),(13,2,1,'帽子很拉风，但是总感觉好像哪里不对。。。','/img/joke_web_1405922851842.jpg',247,10,56,60,2,'2014-07-21 14:07:49',0),(14,2,1,'大师，你这么吊济公知道吗？','/img/joke_web_1405922895613.jpg',267,58,78,88,0,'2014-07-21 14:08:33',0),(15,2,1,'这位同学，你以为穿个花裤衩就能变成高富帅了么？','/img/joke_web_1405922953565.jpg',220,50,73,59,0,'2014-07-21 14:10:06',0),(16,2,1,'同学们，你们的节操都去了哪里','/img/joke_web_1405923028216.jpg',228,86,82,83,0,'2014-07-21 14:10:54',0),(17,2,1,'p出迷人曲线','/img/joke_web_1405923074507.jpg',253,2,89,87,2,'2014-07-21 14:12:38',0),(18,2,1,'孩子，你有强迫症吗？','/img/joke_web_1405923402002.jpg',230,88,51,89,3,'2014-07-21 14:16:51',0),(19,1,4,'朋友问我这纹身多少钱？我说五千。朋友说怎么这么贵？我欲哭无泪，纹身五百，被我爸发现了腿打断医药费四千五。从别处看来的',NULL,3,10,90,84,0,'2014-07-21 18:03:08',0),(20,1,1,'天上着小雨，他和她各自撑着伞在散步，\n她想：“这个笨蛋怎么那么不主动？”\n于是，在路过小桥时，她故意把自己的伞扔到河水里。\n他愣住了。\n她笑着说：“你就这样让我一个人淋雨啊？”\n他恍然大悟，“咻”一声，也把自己的伞扔下去了……',NULL,248,50,97,53,1,'2014-07-21 21:10:15',0),(21,1,1,'去医院打针，一个小护士可能是实习的，比较紧张，拿针头扎了我十下都没找到血管。我咬着牙说道:“大姐，你姓李是吧。”她说：“你怎么知道？”我说很简单啊，因为你一看就是传说中的李十针(时珍)。 ',NULL,233,76,63,61,1,'2014-07-21 21:12:48',0),(22,2,1,'百年修得同船渡，千年修得蛇精病','/img/joke_web_1406005886289.jpg',232,32,78,50,0,'2014-07-22 13:11:55',0),(23,2,1,'遛兔子，大叔果然走在时尚界的前沿','/img/joke_web_1406005930679.jpg',227,60,98,66,2,'2014-07-22 13:13:07',0),(24,2,1,'来，一起数数有几个孙红雷','/img/joke_web_1406005999337.jpg',254,29,59,81,0,'2014-07-22 13:13:30',0),(25,2,1,'真的是好喜庆啊','/img/joke_web_1406006150018.jpg',258,39,52,57,0,'2014-07-22 13:15:56',0),(26,1,1,'“老板，这西瓜这么大我怕吃不完，能不能只买一部分？”\n“可以的，你要多少，我帮你切。 ”\n“不要皮，其他都要。”',NULL,293,75,84,94,0,'2014-07-23 09:51:58',0),(27,1,1,'家有小外甥一枚，姐夫是个超级不正经的男人，但从没做过出轨的事，就是嘴贱！，今天一块吃饭，小外甥突然对我姐说，嘛嘛，今晚你就和粑粑睡一块吧，你们爱怎么样都行，我就当没看见，不然粑粑就憋坏了，说不定哪天就对小姨下手了，然后，一桌都凌乱了。。。',NULL,264,58,64,98,0,'2014-07-23 09:53:20',0),(28,2,1,'想带你去海边吹吹风~','/img/joke_web_1406093347266.jpg',239,51,69,58,0,'2014-07-23 13:29:20',0),(29,2,1,'长大了我就能撬起地球','/img/joke_web_1406093376733.jpg',243,38,53,97,0,'2014-07-23 13:29:52',0),(30,2,1,'看上去就觉得是艺术','/img/joke_web_1406093483704.jpg',253,39,58,63,1,'2014-07-23 13:31:32',0),(31,2,1,'茄子君，你这是为了向兔子君表白特地去整容了吗？','/img/joke_web_1406093503187.jpg',292,35,83,72,1,'2014-07-23 13:33:26',0),(32,2,1,'高端的盒饭','/img/joke_web_1406093619996.jpg',233,96,91,72,0,'2014-07-23 13:34:01',0),(33,2,1,'我靠，又帅了！','/img/joke_web_1406093653589.jpg',225,94,58,95,0,'2014-07-23 13:34:25',0),(34,2,1,'中枪了木有？','/img/joke_web_1406093679125.jpg',249,17,67,57,0,'2014-07-23 13:34:50',0),(35,2,1,'谁家的喵星人这么虎','/img/joke_web_1406093992734.jpg',209,78,63,54,2,'2014-07-23 13:40:02',0),(36,2,1,'杜甫，你还好吗？','/img/joke_web_1406094047800.jpg',219,61