，21.1%、14.1%、12.8%、7.6%。而在偏高消费群，其占比则分别为7.0%、12.1%、17.9%、26.7%、24.5%，在高消费群体，其占比则为0、4.5%、5.9%、7.1%、6.9%，值得注意的是，在B罩杯的消费群体中，其中9成以上都处于中低的消费水平。而G罩杯的姑娘中，8成以上都处于中高消费水平。','/img/joke_web_1407812059675.png',212,72,61,72,0,'2014-08-12 10:54:22',0),(527,1,5,' 所谓成长，就是在听到“波涛汹涌”四个字再也联想不到大海了。 ',NULL,210,21,84,68,0,'2014-08-12 10:55:28',0),(528,2,2,'今儿网上流传的动物园站票价图显示，地铁4号线动物园站到各站的票价最低为2元，最高为10元。北京轨道交通部门回应称，网传图片是为了票价调整委托设计公司设计的版面效果样图，其中提到的票价为假想价格，与政府定价方案无关','/img/joke_web_1407812512106.jpg',246,10,90,76,0,'2014-08-12 11:02:17',0),(529,2,5,'狂拽炫酷屌炸天系列1','/img/joke_web_1407812777414.gif',243,15,99,74,0,'2014-08-12 11:06:19',0),(530,2,9,'狂拽炫酷屌炸天系列2','/img/joke_web_1407812793885.gif',203,62,76,94,0,'2014-08-12 11:06:35',0),(531,2,14,'狂拽炫酷屌炸天系列3','/img/joke_web_1407812806271.gif',210,36,83,99,0,'2014-08-12 11:06:47',0),(532,2,5,'狂拽炫酷屌炸天系列4','/img/joke_web_1407812821844.gif',214,0,89,61,0,'2014-08-12 11:07:03',0),(533,2,1,'狂拽炫酷屌炸天系列5','/img/joke_web_1407812838731.gif',257,20,93,59,0,'2014-08-12 11:07:19',0),(534,2,17,'狂拽炫酷屌炸天系列6','/img/joke_web_1407812853910.gif',232,65,51,62,0,'2014-08-12 11:07:35',0),(535,2,9,'狂拽炫酷屌炸天系列7','/img/joke_web_1407812869183.gif',254,59,78,83,0,'2014-08-12 11:07:51',0),(536,2,2,'狂拽炫酷屌炸天系列8','/img/joke_web_1407812884435.gif',218,41,84,79,0,'2014-08-12 11:08:05',0),(537,2,17,'狂拽炫酷屌炸天系列9','/img/joke_web_1407812895834.gif',246,27,88,96,0,'2014-08-12 11:08:17',0),(538,2,17,'看图猜名字1','/img/joke_web_1407813126358.gif',246,99,88,95,0,'2014-08-12 11:12:07',0),(539,2,6,'看图猜名字2','/img/joke_web_1407813134692.gif',288,46,78,87,1,'2014-08-12 11:12:15',0),(540,2,4,'看图猜名字3','/img/joke_web_1407813142839.gif',236,94,74,50,0,'2014-08-12 11:12:23',0),(541,2,14,'看图猜名字4','/img/joke_web_1407813151104.gif',257,53,88,90,0,'2014-08-12 11:12:32',0),(542,2,25,'看图猜名字5','/img/joke_web_1407813159976.gif',213,76,70,52,0,'2014-08-12 11:12:41',0),(543,2,4,'看图猜名字6','/img/joke_web_1407813169208.gif',245,59,84,89,0,'2014-08-12 11:12:51',0),(544,2,1,'看图猜名字7','/img/joke_web_1407813179097.gif',241,38,62,9