,235,95,57,56,0,'2014-10-18 10:29:48',0),(2253,1,5,'一个数学老师的名言\n1、  北京的房价很贵，贵的离谱，有的人就像自由向量一样。\n2、  比如你晚上睡觉，但是有人在你的床上吃了方便面，洒在了上面，你一抖床单，诶，那个曲面很漂亮对吧？\n3、  你要是把书都搞懂了还没过，我就替你考去。。。替考是不行的是吧？（笑）不行可以想办法~\n4、  你们前两周干什么去了呀？（众人：农大~~~~）（惊讶的）你们学种树去了呀！\n5、  这个可以看成一只小蜜蜂，不是飞在花丛中啊~这个蜜蜂飞在xoy面上方下方，当然这不是水平面了，（漫不经心的）因为蜜蜂不会钻地。。。',NULL,226,95,90,96,0,'2014-10-18 10:31:33',0),(2254,1,5,'6、  大家看这个“梅”。。。。众人茫然，其实他是想说门\n7、  这道题你们会不会？呃，你们的答案可以是一个字，也可以是两个字。\n8、  这个，我老了，记不住了，再看到你们睡觉一生气就更记不住了。你们要再睡觉，我就。。。我就。。。就会发脾气的。\n9、  你能听清我说话么？（不能）为什么？（你说得太快了）（笑）你反应还挺快的。。。（突然地）这句话你听清了么？\n10、              这道题你会么？（会）好，请坐！（应该先求方向向量）嗯，对。不过我说的请坐（做）不是请你做题，是让你坐下。',NULL,158,77,82,61,0,'2014-10-18 10:32:19',0),(2255,1,5,'一个数学老师的名言\n11、下面你们自己做一下,我看了看,前八排的同学在做这道题,从第九排开始都在做投影上的题……..没听懂是吧?\n12、              呃，这一章完了，这个后几排的同学不要和这章一样。。。\n13、              上节课我说我喜欢打篮球， 其实我也喜欢打乒乓球，昨晚看XX和XX比赛，看得我很生气，那个，是XX的球迷的同学先睡会儿，我说点儿你们别生气啊。\n14、              一元函数的导数的几何意义是什么啊？（斜率~~）是树的斜率还是房子的斜率？\n15、              听清我的话了没有？（没！）。。。没有你还这么勇敢。。。\n16、              这个，4班的一号名字是什么啊？（不会念。。。）这个你给我出难题，我也给你出难题。\n17、              这个作业你们什么时候能交啊？下学期？嗯，还好你们没说下辈子。。。',NULL,284,42,88,69,2,'2014-10-18 10:33:29',0),(2256,1,5,'一个数学老师的名言\n1.（讲解无穷大时）什么是无穷大呢？（画了一很长的x轴）就是你骑着摩托车沿着x轴一直走。大家想为什么是摩托车而不是小汽车呢？（坏笑）因为x轴是条线，太窄了……\n2.（讲解函数凹凸性）我不太喜欢这一节，每次讲这个我都会想起我的头发（微秃），那个…（严肃且淡定地）我建议把这一节删掉……\n3.（没听见下课铃，一直上到了第二节快下课）我怎么觉得今天这么奇怪呢？（众人：没下课！）我也很奇怪，你们也很奇怪，怎么都不睡觉了呢？\n4.这个，你们可以给我提要求么，当然，你们也不要太…你们说，这个，我长得不帅，我也不能去韩国整个容么，要不你们上课光看我了，都不看题了……',NULL,77,16,95,60,0,'2014-10-18 10:44:27',0),(2257,1,5,'一个数学老师的名言\n5.（参考3）上课中，手机响了，他解释说：嗯，今天忘关机了，短暂的沉默后：哦，这是下课的闹铃，上次没听见下课铃，我这次定了一个……\n6.这个答案，按要求是不给你们的，但是我放在这，你们拿走了我也没办法……\n7.计算机处理的数值是有限的，要是超出这个数值，它就想不过来了，就发疯了，一发疯就死掉了，这就叫死机.\n8.大家知道零点乐队为什么叫零点么？据我分析，他们总是白天睡觉，晚上十二点以后开始唱歌……\n9.（讲不定积分符号∫）这个像小虫子的东西…是像小虫子么？像个海马哦…其实把“s”拉长，中间拉直了就是积分号了\n   “ʌ”其实就是把“A”倒过来，为什么不把“B”倒过来呢，这个，因为倒过来差别不大，是吧？',NULL,202,99,63,95,0,'2014-10-18 10:45:10',0),(2258,1,5,'一个数学老师的名言\n11.我建议，不会的题，你们就借本作业抄，呃，听起来有点反动啊，但是有些同学是要交了才抄，这样的同学，我建议，直接拉出去…斩了…\n12.这个，我给你们说的你们别给别人说，要不你们就没优势了。\n13.嗯，这个下次课你们早点来，我也早点来，咱们把作业抽查下。\n14.（讲省略写法）为什么要这么写呢？因为这个写法低碳，比较节约纸张，写的快了还节约能源。\n15.通过刚才那个题…嗳~刚才是哪个题？\n16.这个听懂了没有？怎么睡觉的同学一点反应都没有？这个…让你们看一道你们不会的题。\n17.等会儿啊，我打个电话就下课~没人接，我是给谁打电话？（笑）你们可能觉得奇怪啊，但是，是这样的，有位同学给我发了个短信，他说：老师，我想跟你说句话，该下课了…',NULL,342,84,80,94,0,'2014-10-18 10:46:25',0),(2259,1,812,'一天我朋友和我一起吃饭  然后他出去买东西   手机丢我这里忘拿了   后来他用别人手机打他自己的电话  我接的   他特别着急的说了一句   小宝  我手机在你那里吗',NULL,7,5,61,87,0,'2014-10-18 12:13:02',0),(2261,1,786,'我:老师，你不是说boy和girl都是一样的么？\n老师:这就是你闯厕所的原因？',NULL,18,0,66,51,1,'2014-10-18 12:50:28',0),(2265,1,6,'一次和女友逛街，她说要吃棒棒糖，我说，你就像你的胸一样。她问为什么，然后我神回复了一句:“永远长不大”。\n“站住，别跑…” ',NULL,373,43,98,98,0,'2014-10-18 13:36:36',0),(2266,1,6,'今天政治老师在讲台上啰嗦了一个小时，总在说钱与人生的关系，最后要下课了布置了一个问题让我们思考，如果你们有钱能改变什么吗？角落冷哼了一句“如果有钱我就不用在这听你废话了。” ',NULL,381,66,90,86,1,'2014-10-18 13:40:32',0),(2267,1,6,'昨天和女同事去旅游，晚上住宾馆，女同事说:为了省钱，我两开一个房间吧！我听了当时就生气了。妈的，我像付不起房费的人嘛？来俩房间！ ',NULL,364,48,59,86,1,'2014-10-18 13:42:28',0),(2268,1,6,'我也入过传销，被朋友骗去后我天天吃了睡，睡了吃，上课时我也是睡眼惺忪的状态，与其他人的兴奋亢奋的发财梦状态格格不入，最后他们说我是稀泥扶不上墙撵我走，我说走可以，没路费走不了，他们给了三百块路费我才走。 ',NULL,87,63,75,74,0,'2014-10-18 14:41:58',0),(2269,1,6,'在家收到一wifi，上面写着密码是woshidasb,然后我就我就输入woshidasb.果然不对。呵呵呵呵，人与人之间叫最基本得信任都没有了 ',NULL,387,8,99,62,0,'2014-10-18 14:42:35',0),(2271,1,6,'A:这位先生，一看你就是有钱人啊\nB:小伙子，眼光不错，你怎么看出来的？\nA:长的这么丑还能如此自信，肯定是土豪啊。。。。 ',NULL,114,27,71,87,0,'2014-10-18 14:49:36',0),(2272,1,6,'和小区的一大爷下了一上午象棋。互有输赢。到吃饭点我要走，大爷说什么不同意。要么再下一局，要么和他拜把子。好吧，那就拜把子吧。\n大爷说“咱们就以这棋盘起誓，苍天在上，厚土再下，我老刘头和xx愿结为异性兄弟，不求同年同日生，但愿...”\n“等等大爷，我还是和你下一局吧” ',NULL,509,12,56,51,0,'2014-10-18 14:53:19',0),(2276,2,6,'开挂了？','/img/joke_6_1413615599481.jpg',424,33,71,94,2,'2014-10-18 14:59:59',0),(2277,2,6,'某动物园教育老虎不要逃跑的方法。我有点醉了。。。','/img/joke_6_1413615728680.jpg',486,54,85,70,2,'2014-10-18 15:02:08',0),(2279,1,6,'一小孩老爱说瞎话，他妈对他爸说：咱孩子对谁都整天瞎话连篇，长大能干啥啊？他爸淡定的说：没事，去干天气预报！ ',NULL,437,42,64,66,0,'2014-10-18 15:32:53',0),(2285,2,6,'           ','/img/joke_6_1413618158945.jpg',287,74,65,69,0,'2014-10-18 15:42:38',0),(2286,2,6,'呆萌呆萌的。。。-.-','/img/joke_6_1413618279043.jpg',163,43,84,99,2,'2014-10-18 15:44:39',0),(2288,1,57,'老