大森林里一天，狐狸在吸大麻，这时小兔子从远处跑来，看到这一切，走过来说：狐狸狐狸，你怎么能吸大麻呢，对身体不好的，看，空气多么新鲜啊，快来和我一起跑步吧。狐狸想想也对，于是就和小兔子一起跑步，跑着跑着，他们看到大象正在吸海洛因，小兔子跑过去对大象说：大象啊大象，你干嘛吸毒呢，看空气多么的新鲜，和我一起跑步吧。大象想来也对，就个他们两一起跑步。 跑着跑着，看到了狮子卷起袖子，正要注射海洛因，小兔子远远的对着狮子喊：狮子啊狮子，吸毒对身体不好啊，看空气多么新鲜，和我一起跑步吧... 只见狮子放下注射器冲了过来，把小兔子狂扁了一顿，大象战战兢兢对狮子说：你为什么打小兔子啊，他不想我们伤害身体多好啊！狮子说：自从兔子吃了摇头丸之后，就天天让我跟他一起跑步！',NULL,2,0,63,93,0,'2014-11-14 17:40:25',0),(3593,1,1580,'有一天，老师带一群小朋友到山上采水果，\n　　他宣布说:“小朋友，采完水果后，我们统一一起洗，洗完可以一起吃。”\n　　所有小朋友都跑去采水果了。\n　　集合时间一到，所有小朋友都集合了。\n　　老师:“小华，你采到什么？”\n　　小华:“我在洗苹果，因为我采到苹果。”\n　　老师:“小美你呢？”\n　　小美:“我在洗蕃茄，因为我采到蕃茄。”\n　　老师:“小朋友都很棒哦！那阿明你呢？”\n　　阿明:“我在洗布鞋，因为我踩到大便。”',NULL,2,0,58,97,0,'2014-11-14 17:44:42',0),(3594,1,1580,'三只小猪，猪A的名字叫\"谁\"，猪B的名字叫\"哪儿\"，猪C的名字叫\"什么\",他们的爸爸叫“天哪”，他们的爷爷叫“为什么”。有一天，猪A和猪B站在门口，猪C在屋顶上。一只狼发现了它们，想要吃掉它们，于是冲到猪A面前…… \n狼：你是谁？ \n猪A：对，我是谁！ \n狼：什么？ \n猪A：什么在屋顶。 \n狼：我是问你的名字是什么？ \n猪A：我叫谁，什么在屋顶。 \n狼又问猪B。 \n狼：你是谁？ \n猪B：我不是谁，它是谁（指着猪A） \n狼：你认识它？ \n猪B：恩。 \n狼：它是谁？ \n猪B：是的。 \n狼：什么？ \n猪B：什么在屋顶。 \n狼：哪儿？ \n猪B：哪儿是我。 \n狼：谁？ \n猪B：它是谁（又指着猪A） \n狼：我怎么知道。 \n猪B：你找\"谁\"？ \n狼：什么？ \n猪B：它在屋顶上。 \n狼：哪儿？ \n猪B：是我。 \n狼：谁？ \n猪B：我不是谁，它是谁。 \n狼：天哪！ \n猪A猪B：\"天哪\"是我们的爸爸。 \n狼：什么，是你们爸爸？ \n猪B：不是！ \n狼受不了了，仰天长叹：\"为什么？',NULL,7,0,53,57,0,'2014-11-14 17:46:48',0),(3595,1,1580,'老婆花巨资做了整容，数天后变成美女回家！进门时，对一脸疑惑的丈夫说：“怎么？不认识我了？” 丈夫愣了一下，然后惊喜地说                   ：“快进来，我老婆不在家。”',NULL,4,0,92,95,0,'2014-11-14 17:52:07',0),(3596,1,1580,'妈：“儿子、儿子！来！‘It is too easy！’是啥？”\n　　儿子：“‘这太简单了’。”\n　　妈妈：“简单还不快说？”\n　　儿子：“啊就是‘太简单了’呀！”\n　　妈妈：“你以为我不会打你吧？”\n　　语毕，就将儿子教训了一顿。\n　　接着，妈妈又问：\n　　“‘what’这字何解？”\n　　儿子：“‘什么’。”\n　　妈妈：“我说：‘what’是啥意思？”\n　　儿子：“‘什么’！”\n　　说完，妈妈又把儿子教训一顿……',NULL,2,0,50,56,0,'2014-11-14 17:53:16',0),(3597,1,1580,'某大学新楼落成一雕塑：一位少女左手捧一本书，右手高擎一只象征和平的鸽子．该校外公开向各学生征集名称，结果许多人的标语不谋而合——读书顶个鸟用！\n，一兄得便秘，在厕所里久久不能如便，正在他极力努力的时候，看一哥们风一样的冲进厕所，进了他旁边的位置，刚进去就传来一真狂风暴雨，那兄羡慕的对那哥们说：哥们好羡慕你呀，\n那哥们说：羡慕啥，裤子还没脱呢～～\n 学里丢自行车情况特严重，新车眨眼就没，不过有时运气好，丢失的自行车隔几天又会冒出来。一日，同宿舍小静新买了一辆变速车，她逢人便炫耀说：“这车我上了最新式的锁！“第二天，小静上晚自习回，一副萎靡不振的样子，手里还捏了一张纸条，上面写着：别当这儿没高手，车我借走了，过几天还你！\n\n不几日，那贼真的把车给还回来了，小静很是高兴，但她担心车被再次“借“走。遂买了十把大锁，把车子五花大绑地锁了个