观了…说多了全是泪……没脸活下去了...... ',NULL,4,1,93,91,0,'2014-12-19 13:25:28',0),(4532,1,2,'我爸给家里新来的三只小狗起名叫做“曦曦”、“黑黑”、“哈哈”，小狗一般都是我来遛…… 这天去公园，三只小狗乱跑，于是我忙四处招呼道：“嘻嘻嘻嘻嘻嘻过来嘿嘿嘿嘿来啊哈哈哈哈别跑……” 顿时旁边一对情侣用惊恐的眼光打量我，绕开我快步离去…… ',NULL,3,0,74,88,0,'2014-12-19 13:25:44',0),(4533,1,17,'上周，公司派我出差。 \n刚入住酒店，我就接到老婆的电话.... \n老婆：老公，大事不好。今天咱们小区混进了几个贼，咱家也被光顾了！ \n我急忙问：丢东西了吗？有没有报警？ \n老婆：家里被翻得乱七八糟，衣橱里的1万块没了。还丢了什么东西，我正在清理，警察下午来看过了。好在那几个贼已经被警察抓住了，现在让各家尽快报失窃清单去。 \n我：快去看看床头挂的那张结婚照。相框后面有一个用双面胶粘住的红包，里面有两万块！ \n老婆搁下电话。两分钟后.... \n老婆问：我把相框取下来看了，什么也没有。 \n我心想如此神仙难料的地方都能找到，看来今天遇到的绝不是普通的笨贼。 \n我赶紧叫老婆再去卫生间看看，说：马桶水箱靠墙那面有个缝，塞了一个黑色塑料袋，你看看还有没有。 \n5分钟后，老婆打来电话：没有，是不是你记错了地方？ \n我着急地说：不可能。出差前我还检查过。整整4万块，全是连号的百元新钞。那是去年我从公司发给我发的奖金里扣下来的。 \n老婆追问：就这些了吗，还有没有忘记的？ \n我：没有了，只有这6万块。 \n我提醒老婆：一定要把那些钱跟警察讲清楚。 \n老婆轻松淡定，回答：好的。感谢你在本次家庭防盗演习中的出色表现.... \n我立即晕倒，仰天长啸：“女人，你到底是啥东西变的？”',NULL,6,0,89,89,0,'2014-12-19 13:26:32',0),(4534,1,19,'夏天天气比较热，，容易犯困，同学跟我说把鞋脱了脚就凉快了，这样人就精神了，，我照做了，于是全班同学都精神了',NULL,9,0,85,78,0,'2014-12-19 13:26:57',0),(4535,1,9,'今天老师把男女各分一组，玩“你划我猜”这个游戏，轮到女生们猜了，糖糖为了不为难她们，写了“电影院”三个字。糖糖还在下面提示说：情侣最常去的地方。只听见上面女生一致的说出“旅店”。',NULL,6,0,97,60,0,'2014-12-19 13:27:40',0),(4536,1,1639,'一老师去学校应聘，校长问：数学语文英语历史地理，你能教哪门？有十五年教龄的老师骄傲的说：我全能教！次日新闻：我市抓获一邪教教徒！\n                                     wye、',NULL,4,1,79,76,0,'2014-12-19 18:05:25',0),(4537,1,1639,'跟美女同事一路回家。爱美的她穿了一件薄外套，奈何寒风凛凛吹得她打颤，我问她：“冷吗？”\n她点点头。\n这是个机会，我急忙拉开拉链：“来！穿我的！”\n美女感动的说：“谢谢，外套就好了，不要裤子。\n                                 wye、',NULL,7,0,93,73,0,'2014-12-19 18:05:58',0),(4538,1,1639,'小明的爸爸昨天打了他两次。第一次，小明被爸爸看到他拿着一张试卷，上面只有20分。然后就痛扁了他，打完后小明爸爸才发现那张卷子是他自己小时侯的，于是又把小明狠狠揍了一顿……\n                                         wye、',NULL,19,0,104,93,11,'2014-12-19 18:06:18',0),(4539,2,1639,'.','/img/joke_1639_1418984108209.jpg',2,0,97,97,0,'2014-12-19 18:15:08',0),(4543,1,25,'吃素一年，却发现体重更重了，这不科学啊！随后上网搜索发现：食草动物往往体形都大……',NULL,6,0,66,61,0,'2014-12-20 16:39:18',0),(4544,1,24,'我和周旭喜欢上同一个女生，那天说好谁喝酒输了就到她宿舍楼下喊一句：王小萱我爱你。结果周旭先喝吐了，我叫他说话算数，可他死活不去。趁天黑，我一个人跑到女生楼下大喊：王小萱，我是周旭，我爱你……多年后同学会上聊起这事，王小萱对我说：可惜是周旭，如果换了你，我多半就答应了。',NULL,3,0,51,8